import React from "react";
import ReactDom from "react-dom";
import Nav from "./Nav.js";
import HomePage from "./HomePage.js";
import Info from "./Info.js";
import ServicesOffering from "./ServiceOffering.js"
import DigitalLandscape from "./DigitalLandscape.js";
import DrivingProperty from "./DrivingProperty.js";
import DrivingProperty1 from "./DrivingProperty1.js";
import Mind from "./Mind.js";
import Footer from "./footer.js";
import Contact from "./Contact.js";
import Frequently from "./Frequently.js";

let App = () => {

  return (<>
    <Nav />
    <HomePage />
    <Info />
    <ServicesOffering />
    <DigitalLandscape />
    <DrivingProperty />
    <DrivingProperty1 />
    <Mind />
    <Frequently />
    <Contact />
    <Footer />
  </>);
}
export default App;
